import Vue from "vue";
import VueRouter from "vue-router";

Vue.use(VueRouter);

const routes = [
  { path: "/", redirect: "/qf-home" },
  {
    path: "/home",
    name: "Home",
    meta: { title: "隐私条款" },
    component: () => import("../views/HomeView.vue"),
  },
  {
    path: "/prvqflow",
    name: "qflow",
    component: () => import("../views/TargetOne.vue"),
  },
  {
    path: "/prvqflow2",
    name: "qflow",
    component: () => import("../views/TargetTwo.vue"),
  },
  {
    path: "/qf-home",
    name: "home",
    component: () => import("../views/Home.vue"),
  },
  {
    path: "/404",
    component: () =>
      import(/* webpackChunkName: "404" */ "../views/404View.vue"),
    meta: { title: "404" },
  },
  {
    path: "/403",
    component: () =>
      import(/* webpackChunkName: "403" */ "../views/403View.vue"),
    meta: { title: "403" },
  },
  {
    path: "*",
    redirect: "/404",
  },
];

const router = new VueRouter({
  mode: "history",
  base: process.env.BASE_URL,
  routes,
});

export default router;
